import './App.css';
import React from 'react';

function App() {
  const [data, setData] = React.useState(null);
  const url = "http://localhost:3001/api/users"

  React.useEffect(()=>{
    fetch(ur).then( res => {
      console.log(res)
        return res.json
      }).then( received => {
        return setData(received.message)
      }).catch( err=>{
        console.log(err)
      })
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <h1>{data}</h1>
      </header>
    </div>
  );
}

export default App;
